import React, { useState, useCallback } from "react";
import ReactPlayer from 'react-player';
import "./VideoPlayer.css";

const VideoPlayer = ({ videoUrl, playback, ready }) => {

    const setReady = () => ready = true;
    
    const play = () => playback = false;

    return (
        <div id="VideoControls">
            <ReactPlayer
                controls
                width="900px" height="540px"
                url={videoUrl}
                volume={0.5}
                onReady={setReady}
                onStart={play}
                muted={!playback}
                playing={playback}
            />
        </div>
    )
}

export default VideoPlayer;
